pragma solidity ^0.5.0;

contract ReportService {
   string vehicleid;
   string price;
   string reading;
   string transferredto;

function setReportChange(string memory _vehicleid, string memory _price,string memory _reading,string  memory _transferredto) public {
      vehicleid = _vehicleid;
      price= _price;
      reading = _reading;
      transferredto = _transferredto;

   }

   function getReportChange() public view returns (string memory,string memory,string memory,string memory) {
       return ( vehicleid,price,reading,transferredto);

   }

}
